nkings.sport_baseball&quot;:&quot;Baseball&quot;,&quot;rankings.sport_softball&quot;:&quot;Softball&quot;,&quot;rankings.sport_baseball5&quot;:&quot;Baseball5&quot;,&quot;world&quot;:&quot;Welt&quot;,&quot;event_home&quot;:&quot;Home&quot;,&quot;batting_ab_tooltip&quot;:&quot;AB \u2013 At Bat | an at-bat comes when a batter reaches base via a fielder\u2019s choice, hit or an error (not including catcher\u2019s interference) or when a batter is put out on a non-sacrifice.&quot;,&quot;batting_r_tooltip&quot;:&quot;R \u2013 Run | a player is awarded a run if he crosses the plate to score his team a run.&quot;,&quot;batting_h_tooltip&quot;:&quot;H \u2013 Hit | occurs when a batter strikes the baseball into fair territory and reaches base without doing so via an error or a fielder\u2019s choice.&quot;,&quot;batting_2b_tooltip&quot;:&quot;2B \u2013 Double | a batter is credited with a double when he hits the ball into play and reaches second base without the help of an intervening error or attempt to put out another baserunner.&quot;,&quot;batting_3b_tooltip&quot;:&quot;3B \u2013 Triple | a triple occurs when a batter hits the ball into play and reaches third base without the help of an intervening error or attempt to put out another baserunner.&quot;,&quot;batting_hr_tooltip&quot;:&quot;HR \u2013 Home Run | occurs when a batter hits a fair ball and scores on the play without being put out or without the benefit of an error.&quot;,&quot;batting_rbi_tooltip&quot;:&quot;RBI \u2013 Run Batted In | a batter is credited with an RBI in most cases where the result of his plate appearance is a run being scored. There are a few exceptions, however. A player does not receive an RBI when the run scores as a result of an error or ground into double play.&quot;,&quot;batting_tb_tooltip&quot;:&quot;TB \u2013 Total Bases | refer to the number of bases gained by a batter through his hits. A batter records one total base for a single, two total bases for a double, three total bases for a triple and four total bases for a home run.&quot;,&quot;batting_avg_tooltip&quot;:&quot;AVG \u2013 Batting Average | batting average is determined by dividing a player\u2019s hits by his total at-bats for a number between zero (shown as .000) and one (1.000).&quot;,&quot;batting_slg_tooltip&quot;:&quot;SLG \u2013 Slugging Percentage | represents the total number of bases a player records per at-bat. The formula for slugging percentage is: (1B + 2Bx2 + 3Bx3 + HRx4)\/AB.&quot;,&quot;batting_obp_tooltip&quot;:&quot;OBP \u2013 On Base Percentage | refers to how frequently a batter reaches base per plate appearance. Times on base include hits, walks and hit-by-pitches, but do not include errors, times reached on a fielder\u2019s choice or a dropped third strike.&quot;,&quot;batting_ops_tooltip&quot;:&quot;OPS \u2013 On Base Plus Slugging Percentage | adds on-base percentage and slugging percentage to get one number that unites the two. It\u2019s meant to combine how well a hitter can reach base, with how well he can hit for average and for power.&quot;,&quot;batting_bb_tooltip&quot;:&quot;BB \u2013 Base on Balls | occurs when a pitcher throws four pitches out of the strike zone, none of which are swung at by the hitter.&quot;,&quot;batting_hbp_tooltip&quot;:&quot;HBP \u2013 Hit by Pitch | occurs when a batter is struck by a pitched ball without swinging at it. He is awarded first base as a result. Strikes supersede hit-by-pitches, meaning if the umpire rules that the pitch was in the strike zone or that the batter swung, the HBP is nullified.&quot;,&quot;batting_so_tooltip&quot;:&quot;SO \u2013 Strike Out | represents the number of times a batter records an out by striking out, both looking and swinging.&quot;,&quot;batting_gdp_tooltip&quot;:&quot;GDP \u2013 Ground into Double Play | occurs when a player hits a ground ball that results in multiple outs on the bases.&quot;,&quot;batting_sf_tooltip&quot;:&quot;SF \u2013 Sacrifice Fly | occurs when a batter hits a fly-ball out to the outfield or foul territory that allows a runner to score.&quot;,&quot;batting_sh_tooltip&quot;:&quot;SH \u2013 Sacrifice Hit | occurs when a player is successful in his attempt to advance a runner (or multiple runners) at least one base with a bunt.&quot;,&quot;batting_sb_tooltip&quot;:&quot;SB \u2013 Stolen Base | number of times a player steals a base.&quot;,&quot;batting_cs_tooltip&quot;:&quot;CS \u2013 Caught Stealing | number of times a runner is recorded as an out while attempting to steal a base.&quot;,&quot;pitching_w_tooltip&quot;:&quot;W \u2013 Win | a pitcher receives a win when he is the pitcher of record when his team takes the lead for good \u2014 with a couple rare exceptions. First, a starting pitcher must pitch at least five innings (in a traditional game of nine innings or longer) to qualify for the win. If he does not, the official scorer awards the win to the most effective relief pitcher.&quot;,&quot;pitching_l_tooltip&quot;:&quot;L \u2013 Loss | a pitcher receives a loss when a run that is charged to him proves to be the go-ahead run in the game, giving the opposing team a lead it never gives up.&quot;,&quot;pitching_era_tooltip&quot;:&quot;ERA \u2013 Earned Run Average | represents the number of earned runs a pitcher allows per nine innings (or the length of the game of the category), with earned runs being any runs that scored without the aid of an error or a passed ball.&quot;,&quot;pitching_app_tooltip&quot;:&quot;APP \u2013 Appearance | a pitcher is credited with an appearance if he pitches in a given game.&quot;,&quot;pitching_gs_tooltip&quot;:&quot;GS \u2013 Game Started | a pitcher is credited with a game started if he is the first pitcher to throw a pitch for his team in a given game.&quot;,&quot;pitching_sv_tooltip&quot;:&quot;SV - Save | A save is awarded to the relief pitcher who finishes a game for the winning team, under certain circumstances. A pitcher cannot receive a save and a win in the same game. A relief pitcher recording a save must preserve his team&#039;s lead while doing one of the following: Enter the game with a lead of no more than three runs and pitch at least one inning; Enter the game with the tying run in the on-deck circle, at the plate or on the bases; Pitch at least three innings.&quot;,&quot;pitching_cg_tooltip&quot;:&quot;CG \u2013 Complete Game | a pitcher earns a complete game if he pitches the entire game for his team regardless of how long it lasts.&quot;,&quot;pitching_sho_tooltip&quot;:&quot;SHO \u2013 Shutout | a starting pitcher is credited with a shutout when he pitches the entire game for a team and does not allow the opposition to score.&quot;,&quot;pitching_ip_tooltip&quot;:&quot;IP \u2013 Innings Pitched | measures the number of innings a pitcher remains in a game. Because there are three outs in an inning, each out recorded represents one-third of an inning pitched.&quot;,&quot;pitching_h_tooltip&quot;:&quot;H \u2013 Hits | total hits allowed by pitcher.&quot;,&quot;pitching_r_tooltip&quot;:&quot;R \u2013 Runs | the number of runs the pitcher has allowed, both earned and unearned.&quot;,&quot;pitching_er_tooltip&quot;:&quot;ER \u2013 Earned Runs | any run that scores against a pitcher without the benefit of an error or a passed ball. Often, it is the judgment of the official scorer as to whether a specific run would\u2019ve scored without the defensive mishap.&quot;,&quot;pitching_bb_tooltip&quot;:&quot;BB \u2013 Base on Balls | refers to how many walks the pitcher has allowed.&quot;,&quot;pitching_so_tooltip&quot;:&quot;SO \u2013 Strike Out | occurs when a pitcher throws any combination of three swinging or looking strikes to a hitter. (A foul ball counts as a strike, but it cannot be the third and final strike of the at-bat. A foul tip, which is caught by the catcher, is considered a third strike.)&quot;,&quot;pitching_2b_tooltip&quot;:&quot;2B \u2013 Doubles Allowed | refers to how many doubles the pitcher has allowed.&quot;,&quot;pitching_3b_tooltip&quot;:&quot;3B \u2013 Triples Allowed | refers to how many triples the pitcher has allowed.&quot;,&quot;pitching_hr_tooltip&quot;:&quot;HR \u2013 Home Runs Allowed | refers to how many home runs the pitcher has allowed.&quot;,&quot;pitching_ab_tooltip&quot;:&quot;AB \u2013 At Bats Against | a count of the number of total at bats against a certain pitcher or team.&quot;,&quot;pitching_bavg_tooltip&quot;:&quot;BAVG \u2013 Opponent Batting Average | hits allowed divided by at-bats faced.&quot;,&quot;pitching_wp_tooltip&quot;:&quot;WP \u2013 Wild Pitch | a pitcher is charged with a wild pitch when his pitch is so errant that the catcher is unable to control it and, as a result, baserunner(s) advance.&quot;,&quot;pitching_hb_tooltip&quot;:&quot;HB \u2013 Hit Batter | times hit a batter with pitch, allowing runner to advance to first base.&quot;,&quot;pitching_bk_tooltip&quot;:&quot;BK \u2013 Balk | occurs when a pitcher makes an illegal motion on the mound that the umpire deems to be deceitful to the runner(s). As a result, any men on base are awarded the next base, and the pitch (if it was thrown in the first place) is waved off for a dead ball.&quot;,&quot;pitching_sfa_tooltip&quot;:&quot;SFA \u2013 Sacrifice Flies Allowed | refers to how many successful sacrifice flies the pitcher has allowed.&quot;,&quot;pitching_sha_tooltip&quot;:&quot;SHA \u2013 Sacrifice Hits Allowed | ;refers to how many successful bunts the pitcher has allowed.&quot;,&quot;pitching_go_tooltip&quot;:&quot;GO \u2013 Ground Outs | occurs when a batter hits a ball on the ground to a fielder, who records an out by throwing to or stepping on first base. It can also occur when the batter reaches first base \u2014 and the defence instead opts to record an out elsewhere via a \u201cfielder\u2019s choice.\u201d&quot;,&quot;pitching_fo_tooltip&quot;:&quot;FO \u2013 Fly Outs | occurs when a batter hits the ball in the air and an opposing defender catches it before it hits the ground or fence.&quot;,&quot;pitching_whip_tooltip&quot;:&quot;WHIP - Walks and Hits per Inning Pitched | is one of the most commonly used statistics for evaluating a pitcher&#039;s performance. The statistic shows how well a pitcher has kept runners off the basepaths, one of his main goals. The formula is simple enough -- it&#039;s the sum of a pitcher&#039;s walks and hits, divided by his total innings pitched.&quot;,&quot;fielding_g_tooltip&quot;:&quot;G - Games Played | A player is credited with having played a game if he appears in it at any point -- be it as a starter or a replacement.&quot;,&quot;fielding_c_tooltip&quot;:&quot;C \u2013 Chances | Represent the number of opportunities he\/she has to record an out. The formula for chances is: assists plus putouts plus errors.&quot;,&quot;fielding_po_tooltip&quot;:&quot;PO \u2013 Put Outs | a fielder is credited with a putout when he is the fielder who physically records the act of completing an out \u2013 whether it be by stepping on the base for a forceout, tagging a runner, catching a batted ball, or catching a third strike.&quot;,&quot;fielding_a_tooltip&quot;:&quot;A \u2013 Assists | Awarded to a fielder who touches the ball before a putout is recorded by another fielder.&quot;,&quot;fielding_e_tooltip&quot;:&quot;E \u2013 Errors | A fielder is given an error if, in the judgment of the official scorer, he fails to convert an out on a play that an average fielder should have made.&quot;,&quot;fielding_fldp_tooltip&quot;:&quot;FLDP \u2013 Fielding Percentage | Answers how often does a fielder or team make the play when tasked with fielding a batted ball, throwing a ball, or receiving a thrown ball for an out. The formula is simple: the total number of putouts and assists by a defender, divided by the total number of chances (putouts, assists and errors).&quot;,&quot;fielding_dp_tooltip&quot;:&quot;DP \u2013 Double Play | occurs when two offensive players are ruled out within the same play.&quot;,&quot;fielding_sba_tooltip&quot;:&quot;SBA \u2013 Stolen Bases Allowed (Pitcher and Catcher) | number of times a runner successfully stole a base.&quot;,&quot;fielding_csb_tooltip&quot;:&quot;CSB \u2013 Caught Stealing (Pitcher\/Catcher) | number of times a runner was caught stealing.&quot;,&quot;fielding_sbap_tooltip&quot;:&quot;SBAP \u2013 Stolen Bases Against Percentage (Pitcher and Catcher) | refers to the frequency with which a catcher\/pitcher throw out opposing baserunners who are trying to steal. The formula is simple: CSB divided by total stolen-base attempts (both successful and unsuccessful) against that catcher\/pitcher.&quot;,&quot;fielding_pb_tooltip&quot;:&quot;PB \u2013 Passed Ball (Catcher) | a catcher is given a passed ball if he cannot hold onto a pitch that, in the official scorer\u2019s judgment, he should have, and as a result at least one runner moves up on the bases.&quot;,&quot;fielding_ci_tooltip&quot;:&quot;CI \u2013 Catcher\u2019s Interference | when a catcher (or any other fielder) interferes with a batter at any point during a pitch, the batter is awarded first base if the catcher.&quot;,&quot;1b_coach&quot;:&quot;1B Coach&quot;,&quot;3b_coach&quot;:&quot;3B Coach&quot;,&quot;3rd_vice_president&quot;:&quot;3rd Vice President&quot;,&quot;3rd_vice_president_baseball&quot;:&quot;3rd Vice President Baseball&quot;,&quot;3rd_vice_president_softball&quot;:&quot;3rd Vice President Softball&quot;},&quot;live_bar&quot;:{&quot;games&quot;:[{&quot;id&quot;:154217,&quot;gamestatus&quot;:0,&quot;best_of&quot;:null,&quot;sub_gamenumber&quot;:null,&quot;parent_id&quot;:null,&quot;wbsc_tournament_group_id&quot;:10650,&quot;wbsc_tournament_round_id&quot;:4774,&quot;homeruns&quot;:0,&quot;awayruns&quot;:0,&quot;gamecode&quot;:&quot;&quot;,&quot;homeid&quot;:34410,&quot;gamenumber&quot;:7,&quot;tournamentid&quot;:2465,&quot;federation_id&quot;:0,&quot;awayid&quot;:34407,&quot;start&quot;:&quot;2025-04-11 14:00:00&quot;,&quot;venueid&quot;:1052,&quot;start_tz&quot;:&quot;America\/Mexico_City
